/// <summary>
/// Metadata about a single YAML configuration section.
/// </summary>
internal sealed class YamlSectionMeta
{
    internal YamlSectionMeta(string sectionName, string propertyName, string category, bool isHandWritten, string[] pocoProperties)
    {
        SectionName = sectionName;
        PropertyName = propertyName;
        Category = category;
        IsHandWritten = isHandWritten;
        PocoProperties = pocoProperties;
    }

    /// <summary>The section name (e.g., "Optimizer").</summary>
    internal string SectionName { get; }
    /// <summary>The property name in YamlModelConfig (e.g., "Optimizer").</summary>
    internal string PropertyName { get; }
    /// <summary>Category: Interface, Poco, ConcreteGeneric, AbstractGeneric, Pipeline, Unknown.</summary>
    internal string Category { get; }
    /// <summary>Whether this section is hand-written in YamlModelConfig.cs.</summary>
    internal bool IsHandWritten { get; }
    /// <summary>For Poco sections: "propName:jsonType" entries for each public property.</summary>
    internal string[] PocoProperties { get; }
}
